import { Link } from 'react-router-dom';
import './Navbar.css'


function Navbar(){
    return(
        <nav>
            <div className='container-name'>
                <h1 className='name'>Em</h1>
            </div>
            <div className='container-navbar'>
                <Link to = "/aboutme" className='item'>Home</Link>
                <Link to = "/aboutme" className='item'>About me</Link>
                <Link to = "/skills" className='item'>Habilidades</Link>
                <Link to = "/skills" className='item'>Estudios</Link>

            </div>
        </nav>
    );
}

export default Navbar;
